    dp = [[] for _ in range(n + 1)]
    dp[0].append(1)
    value = [[0 for _ in range(n + 1)] for _ in range(n + 1)]
    for (x, y, val) in intervals:
        value[x][y] = val
    for i in range(n):
        value[i + 1][i + 1] = g[i]
    for i in range(1, n + 1):
        dp[i].extend(dp[i - 1])
        for j in range(i, 0, -1):
            x = 0
            for l in range(j, i + 1):
                for r in range(l, i + 1):
                    x += value[l][r]
            if j == 1:
                dp[i].append(x)
            else:
                for val in dp[j - 2]:
                    dp[i].append(val + x)
        dp[i].sort(reverse=True)
        while len(dp[i]) > k:
            dp[i].pop()
    return dp[n]

